import './projects.css';








function projects() {
    return(
        <>
        <div className="project container z-zIndex: 1  my-4  mx-6 rounded-md  max-h-screen bg-violet-800 shadow-md" >
            <div className="block my-3 mx-3 rounded-md max-w-md bg-slate-400 shadow-md" >
                <img className="block rounded-md max-w-sm"src="https://media.istockphoto.com/id/1398879410/photo/business-woman-looking-at-the-project-management-calendar-in-her-office.webp?b=1&s=170667a&w=0&k=20&c=UqNNit1KbMbjfLgoge4tA7d9-EWOE6AbiotLLBTZi5k="></img>
                <h3 className='text-center italic'></h3>
            </div>
            <div className="block rounded-md max-w-md bg-slate-400 shadow-md" >
                <img className="block rounded-md max-w-sm"src="https://media.istockphoto.com/id/1398879410/photo/business-woman-looking-at-the-project-management-calendar-in-her-office.webp?b=1&s=170667a&w=0&k=20&c=UqNNit1KbMbjfLgoge4tA7d9-EWOE6AbiotLLBTZi5k="></img>
                <h3 className='text-center italic'></h3>
            </div>

            <div className="block rounded-md max-w-md bg-slate-400 shadow-md" >
                <img className="block rounded-md max-w-sm"src="https://media.istockphoto.com/id/1398879410/photo/business-woman-looking-at-the-project-management-calendar-in-her-office.webp?b=1&s=170667a&w=0&k=20&c=UqNNit1KbMbjfLgoge4tA7d9-EWOE6AbiotLLBTZi5k="></img>
                <h3 className='text-center italic'></h3>
            </div>


        </div>
        </>

    );
}

export default projects;
